import React from "react";
import { rutaAPI } from "../../../config/Config";

class Prospecto extends React.Component {
  constructor(props) {
    super(props);
    this.state = { prospectos: [] };
    console.log(this.state);
  }

  componentWillMount() {
    const url = `${rutaAPI}/mostrar-prospecto`;

    const params = {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    };

    fetch(url, params)
      .then((response) => {
        return response.json();
      })
      .then((prospectos) => {
        this.setState({ prospectos: prospectos });
      })
      .catch((err) => {
        this.setState({ prospectos: err });
      });
  }

